  methods: {
    setAnimation() {
      const animation = anime

      animation
        .timeline({
          loop: true,
          direction: 'alternate',
          targets: '.circuits path',
        })
        .add({
          strokeDashoffset: [anime.setDashoffset, 0],
          easing: 'easeInOutQuint',
          duration: anime.random(3000, 6000),
          delay: 1000,
        })
    },
  },
}
